oxy_webhelp_navlinks = {"ncd_data_sets-d22908e34919":{"topics":[{"title":"Unstructured Data dashboard","shortdesc":"<p class=\"shortdesc\">The Unstructured Data dashboard in <span class=\"ph\">RSC<\/span> provides a comprehensive data         protection summary for all connected clusters, displaying statistics on data collection,         archive usage, storage, and the status of protected files and shares.<\/p>","href":"saas\/ncd_unstructured_data_dashboard.html","attributes":{"data-id":"ncd_unstructured_data_dashboard"},"menu":{"hasChildren":false},"tocID":"ncd_unstructured_data_dashboard-d22908e34934","next":"ncd_unstructured_data_dashboard-d22908e34934"},{"title":"Data Observability for <span class=\"ph\">NAS CD<\/span> data sets","shortdesc":"<p class=\"shortdesc\"> To provide Data Observability, you can enable <span class=\"ph\">Data Threat Analytics<\/span> and         configure <span class=\"ph\">Data Security Posture<\/span> for <span class=\"ph\">NAS CD<\/span> data sets. <span class=\"ph\">Data Threat Analytics<\/span> detects ransomware attacks and <span class=\"ph\">Data Security Posture<\/span> identifies sensitive data in your <span class=\"ph\">NAS CD<\/span> data sets.<\/p>","href":"saas\/ncd_data_observability.html","attributes":{"data-id":"ncd_data_observability"},"menu":{"hasChildren":false},"tocID":"ncd_data_observability-d22908e34982","next":"ncd_data_observability-d22908e34982"},{"title":"<span class=\"ph\">RSC<\/span> API proxy for <span class=\"ph\">NAS CD<\/span> REST API","shortdesc":"<p class=\"shortdesc\">Using the <span class=\"ph\">RSC<\/span> API proxy, you can send <span class=\"ph\">NAS CD<\/span> REST API         requests directly to an <span class=\"ph\">RSC<\/span> instance instead of a <span class=\"ph\">NAS CD<\/span>         instance. This simplifies data management across <span class=\"ph\">NAS CD<\/span> clusters and         streamlines API interactions, reduces complexity, and enables efficient management of <span class=\"ph\">NAS CD<\/span> data from a single, secure location.<\/p>","href":"saas\/rsc_api_proxy_nascd_rest_api.html","attributes":{"data-id":"rsc_api_proxy_nascd_rest_api"},"menu":{"hasChildren":false},"tocID":"rsc_api_proxy_nascd_rest_api-d22908e35116","next":"rsc_api_proxy_nascd_rest_api-d22908e35116"},{"title":"<span class=\"ph\">NAS CD<\/span> Inventory Management","shortdesc":"<p class=\"shortdesc\"> Inventory management provides options to view <span class=\"ph\">NAS CD<\/span> data sets and         perform recoveries of their backups.<\/p>","href":"saas\/nascd_inventory_management.html","attributes":{"data-id":"nascd_inventory_management"},"menu":{"hasChildren":false},"tocID":"nascd_inventory_management-d22908e35180","next":"nascd_inventory_management-d22908e35180"},{"title":"<span class=\"ph\">NAS CD<\/span> Recovery","shortdesc":"<p class=\"shortdesc\">You can recover shares from the snapshots on the Overview tab of a share on the <span class=\"ph\">NAS CD<\/span> Inventory page.<\/p>","href":"saas\/nascd_recovery.html","attributes":{"data-id":"nascd_recovery"},"menu":{"hasChildren":false},"tocID":"nascd_recovery-d22908e35216","next":"nascd_recovery-d22908e35216"},{"title":"RBAC for <span class=\"ph\">NAS CD<\/span>","shortdesc":"<p class=\"shortdesc\">You can use role based access control for users to assign a role containing a set of         permissions to a<span class=\"ph\">NAS CD<\/span> user. You can also assign multiple roles to a         user.<\/p>","href":"saas\/rbac_nascd.html","attributes":{"data-id":"rbac_nascd"},"menu":{"hasChildren":false},"tocID":"rbac_nascd-d22908e35252","next":"rbac_nascd-d22908e35252"}]}};